let ProductsList = function ({children}) {
    let css = {
        display: "flex",
        flexWrap: "wrap",
        gap: "200px",
        padding: "50px",
        justifyContent :"center",
        alignItems: "center",
        alignContent: "center"
    }

    return (
        <products-list>
            {children}
        </products-list>
    )
};

export default ProductsList;
